import { ProductProps } from "components/Product/types";
import { CardProduct } from "components/Product/ProductStyled";
import { CardWrapper } from "components/Product/ProductStyled";

const Product = ({ product }: ProductProps): any => {
	return (
		<CardWrapper>
			<CardProduct>
				<div>
					{product.vendorСode}
					<div>
						<img src={product.image} alt={product.name} />
					</div>
				</div>
				<div>
					<div>
						{product.vendorСode}
						<div>
							<span>{product.name}</span>
						</div>
						<div>{product.description}</div>
						<div>{product.price}</div>
					</div>
				</div>
			</CardProduct>
		</CardWrapper>
	);
};

export default Product;
